import styled from "styled-components";

const InputContainerStyled = styled.div`
	display: grid;
	justify-content: center;

	h2 {
		text-align: center;
		color: #ffffff;
	}

	.select-category {
		border: 2px solid #000000;
		margin-bottom: 20px;
	}

	input {
		border: 2px solid #000000;
		border-radius: 5px;
		font-family: "Baloo Chettan 2", cursive;
		font-size: 1rem;
	}
`;

export default InputContainerStyled;
